import { useState } from "react";

function NavBarMenu() {
  const [open, setOpen] = useState(false);

  const handleClick = () => {
    setOpen(!open);
  };

  return (
    <li className={styles.navBarContainer} id="navBarContainer">
      <Link to="/">
        <p>Home</p>
      </Link>
      <Link to="/shows">
        <p>Shows</p>
      </Link>
      <Link to="/contact">
        <p>Contact</p>
      </Link>
      <Link to="/about">
        <p>About</p>
      </Link>
      <a href="javascript:void(0);" open={open} handleClick={handleClick}>
        <i class="fa fa-bars"></i>
      </a>
    </li>
  );
}

export default NavBarMenu;
